import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <div className="container" style={{marginTop:'100px'}}>
      <div className="row align-items-center" >
          <div className="col-md-6">
            <div style={{width:'100%'}} >
              <button type="button btn-lg" className="btn btn-outline-primary">Scanner QR</button>
            </div>
          </div>
          <div className="col-md-6">
            <div style={{width:'100%'}}>
              <button type="button btn-lg" className="btn btn-outline-success">Consultas</button>
            </div>

          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
